import React from 'react';
import './Sidebar.css';

export default function RightSidebar({ models, selectedModel, onSelectModel, sidebarTitle }) {
  return (
    <div className="sidebar right-sidebar">
      <h3 className="sidebar-title">{sidebarTitle}</h3>
      <ul className="sidebar-list">
        {models.map((model) => (
          <li
            key={model.id}
            className={`sidebar-item ${
              selectedModel?.id === model.id ? 'selected' : ''
            }`}
            onClick={() => onSelectModel(model)}
          >
            {model.name}
          </li>
        ))}
      </ul>
    </div>
  );
}
